Forklar TypeScript: Forklar TypeScript er en formell modellering av TypeScript som bidrar til en mer effektiv og klarer programmeringsprosjekt. Forklar TypeScript skal ha flere typer som en klass, men kan også ha flere omhållande typer, som kan brukes for å definere flere typer. Forklar TypeScript er en utvikling av forklegging av TypeScript, som gjør forkleringsstrukturer og typerstyrke mer effektivt. Forkleringsstrukturer innebærer det at en forklegging av et typpesett innebærer flere typer i en forklegging av et annen typpe. Typerstyrken innebærer den sammenhengige formen for en forklegging av et annen typpe og et forklegging av et annen typpe.

Duck Typing: Duck Typing er en formell modellering av TypeScript som beregner at et annen typp kan brukes for flere typer, siden de fleste typer handler identifiske parametere, som kan være variabler eller rettferdigheter. Faktisk har type systemer i typisk programmerings-languageløsninger og beregner den samme parametere ved flere typer, men så langt as det ikke er typet med fjerde eller fler variabler.

Eksempel:

```typescript
type Foo = { bar: number }

type Bar = { foo: string }
type Baz = { bar: number, baz: number }

// Duck Typing er farlig!
let x = new Bar()
x.foo = "hello"
x.bar = 3
// Typen er typet, der er dukket for flere typer!

// Typing er bedre!
let x: Foo = new Bar()

// Fjerde parametere også funger!
let x: Foo = new Baz()

// Sjekk for feil!
let x: Foo = new Baz(3)

// Fjerde parametere varier på åpen data-struktur!
let x: Foo = new Baz(3) as Foo

// Hvis du skal gjøre enkelte tidsdelte datastrukturer, så gjør det i et eget verktøy!
let x1: Foo = new Baz() as Foo
let x2: Bar = new Baz() as Bar
